window.__NUXT__=(function(a,b){return {staticAssetsBase:"\u002F_nuxt\u002Fstatic\u002F1641818998",layout:"default",error:b,state:{posts:[],tags:[{id:14,name:"dam"},{id:13,name:"lol"},{id:15,name:"категория 1"},{id:16,name:"категория 2"},{id:17,name:"категория 3"},{id:18,name:"категория 4"},{id:19,name:"категория 5"},{id:9,name:"Недвижимость строительство и архитектура"},{id:11,name:"переработка отходов"},{id:12,name:"социальные проекты"},{id:8,name:"Услуги и сервис"},{id:10,name:"Экология"}],investors:[{id:155,slug:"nikolaj-2",title:{rendered:"Николай #2"},acf:{name:"Физ. Лицо",mail:"IT-технологии, криптовалюта",photo:"http:\u002F\u002Feksponentum.ru\u002Fwp-content\u002Fuploads\u002F2021\u002F11\u002Fscreenshot.png",budget:"10 000 000 - 15 000 000"}}],customPages:[{id:181,slug:"uslugi",title:{rendered:"Услуги"},content:{rendered:"\u003Cdiv class=\"center\"\u003E\n\u003Ch4 style=\"text-align: center;\"\u003EПеречень предоставляемых услуг\u003C\u002Fh4\u003E\n\u003C\u002Fdiv\u003E\n\u003Cdiv class=\"table\"\u003E\n\u003Ctable\u003E\n\u003Cthead\u003E\n\u003Ctr\u003E\n\u003Cth\u003EНаименование услуги\u003C\u002Fth\u003E\n\u003Cth\u003EСрок исполнения, дн\u003C\u002Fth\u003E\n\u003Cth\u003EСтоимость, руб.\u003C\u002Fth\u003E\n\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EПоднять объявление в списке предложений\u003C\u002Ftd\u003E\n\u003Ctd\u003E1 раз в неделю\u003C\u002Ftd\u003E\n\u003Ctd\u003EБесплатно\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EПремиальное размещение (размещение на видном месте на главной странице + приоритетные позиции в списке проектов)\u003C\u002Ftd\u003E\n\u003Ctd\u003E1 месяц\u003Cbr \u002F\u003E\nВсего 6 мест\u003C\u002Ftd\u003E\n\u003Ctd\u003E1 500\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EРазмещение в телеграм-канале (есть ограничения)\u003C\u002Ftd\u003E\n\u003Ctd\u003E1 раз\u003C\u002Ftd\u003E\n\u003Ctd\u003E100\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EРассылка по e-mail базе инвесторов нашего сайта (вместе с другими проектами, не более 7).\u003C\u002Ftd\u003E\n\u003Ctd\u003E1 раз\u003C\u002Ftd\u003E\n\u003Ctd\u003E1000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003C\u002Fdiv\u003E\n\u003Cdiv class=\"center v2\"\u003E\n\u003Ch5\u003E\u003C\u002Fh5\u003E\n\u003Ch5\u003EОбратите внимание!\u003C\u002Fh5\u003E\n\u003C\u002Fdiv\u003E\n\u003Cdiv\u003E\n\u003Cp\u003EОчень важной составляющей для успешного привлечения инвестиций является пакет инвестиционных документов: договор, презентация, тизер, финансовая модель, бизнес-план, инвестиционный меморандум и другие.\u003C\u002Fp\u003E\n\u003Cp\u003EИменно от качественной подготовки этих документов во многом зависит представление инвестора о вашем бизнесе и, как следствие, принятие положительного решения об инвестициях в вашу компанию.\u003C\u002Fp\u003E\n\u003Cp\u003EПоэтому рекомендуем уделить максимум внимания и усилий для подготовки именно этих документов. В случае, когда вам нужны будут компетенции специалистов нашей компании, то обращайтесь, мы расскажем как это сделать или составим за вас эти документы. Так же можем выступить в качестве инвестиционного агента вашей компании. Самостоятельно составим пакет инвестдокументов и привлечём вам инвестиции с оплатой \u003Cstrong\u003Eза результат!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\n\u003C\u002Fdiv\u003E\n\u003Ch4 style=\"margin-top: 3rem; text-align: center;\"\u003EСопровождение бизнес-проектов\u003C\u002Fh4\u003E\n\u003Cdiv class=\"table\"\u003E\n\u003Ctable\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EКонсультация инвестиционного брокера\u003C\u002Ftd\u003E\n\u003Ctd\u003E1 час\u003C\u002Ftd\u003E\n\u003Ctd\u003E2 500\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EПодготовка тизера проекта\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 4 дней\u003C\u002Ftd\u003E\n\u003Ctd\u003E7 000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EПодготовка презентации проекта\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 10 дней\u003C\u002Ftd\u003E\n\u003Ctd\u003E29 000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EПривлечение инвестиций в бизнес\u003C\u002Ftd\u003E\n\u003Ctd\u003E6 месяцев\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 100 000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EПодготовка бизнес-плана\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 14 дней\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 70 000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EПодготовка бизнес-плана для международных рынков (стандарт UNIDO)\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 20 дней\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 150 000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EСоставление финансовой модели\u003C\u002Ftd\u003E\n\u003Ctd\u003E10\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 25 000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EСоставление финансовой модели сотрудником из BIG-4 с учётом специфики отрасли\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 30 дней\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 250 000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003EАудит существующего бизнес-плана\u003C\u002Ftd\u003E\n\u003Ctd\u003Eот 7 дней\u003C\u002Ftd\u003E\n\u003Ctd\u003E20 000\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003C\u002Fdiv\u003E\n",protected:a},excerpt:{rendered:"\u003Cp\u003EПеречень предоставляемых услуг Наименование услуги Срок исполнения, дн Стоимость, руб. Поднять объявление в списке предложений 1 раз в неделю Бесплатно Премиальное размещение (размещение на видном месте на главной странице + приоритетные позиции в списке проектов) 1 месяц Всего 6 мест 1 500 Размещение в телеграм-канале (есть ограничения) 1 раз 100 Рассылка по e-mail базе инвесторов [&hellip;]\u003C\u002Fp\u003E\n",protected:a}},{id:173,slug:"about",title:{rendered:"О нас"},content:{rendered:"\u003Ch2 class=\"intro-title\"\u003EО нашем проекте\u003C\u002Fh2\u003E\n\u003Cp class=\"intro-desc\"\u003EInvestOffers.ru &#8212; сайт на котором инициаторы проектов и предприниматели находят инвесторов.\u003C\u002Fp\u003E\n\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\n\u003Cdiv\u003E\u003Cstrong\u003EПредпринимателям:\u003C\u002Fstrong\u003E\u003C\u002Fdiv\u003E\n\u003Cp\u003EРазместите своё инвестиционное предложение на нашем сайте и у вас появится реальная возможность привлечь инвестора. Нет готовых документов, бизнес-плана, презентации, не знаете с чего начать? Мы подскажем и поможем составить весь пакет необходимых документов и материалов подробнее на странице Услуги\u003C\u002Fp\u003E\n\u003Cp\u003EРазмещение вашего инвестпредложения совершенно бесплатное. Для этого необходимо зарегистрироваться в качестве автора проекта\u003C\u002Fp\u003E\n\u003Cp\u003EОсновная аудитория площадки это инвесторы, представители инвестфондов и инвестиционных клубов.\u003C\u002Fp\u003E\n\u003Cp\u003EУ инвесторов есть возможность связаться с автором по указанным контактам или через систему личных сообщений.\u003C\u002Fp\u003E\n\u003Cp\u003EДля увеличения привлекательности вашего инвестиционного предложения заполните как можно больше форм в анкете проекта при составлении заявки. Это позволит инвесторам более детально узнать о вашем предложении уже на стадии ознакомления.\u003C\u002Fp\u003E\n\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\n\u003Cdiv\u003E\u003Cstrong\u003EИнвесторам:\u003C\u002Fstrong\u003E\u003C\u002Fdiv\u003E\n\u003Cp\u003EЕсли вы частный инвестор, представитель инвестиционной компании, инвестиционного или венчурного фонда, то вас могут заинтересовать постоянно обновляемая и пополняемая база инвестиционных предложений нашего сайта.\u003C\u002Fp\u003E\n\u003Cp\u003EРегистрируйтесь, подписывайтесь на рассылку инвестпроектов и получайте рассылку предложений 1 раз в неделю.\u003C\u002Fp\u003E\n",protected:a},excerpt:{rendered:"\u003Cp\u003EО нашем проекте InvestOffers.ru &#8212; сайт на котором инициаторы проектов и предприниматели находят инвесторов. &nbsp; Предпринимателям: Разместите своё инвестиционное предложение на нашем сайте и у вас появится реальная возможность привлечь инвестора. Нет готовых документов, бизнес-плана, презентации, не знаете с чего начать? Мы подскажем и поможем составить весь пакет необходимых документов и материалов подробнее на странице [&hellip;]\u003C\u002Fp\u003E\n",protected:a}},{id:2,slug:"sample-page",title:{rendered:"Sample Page"},content:{rendered:"\n\u003Cp\u003EThis is an example page. It&#8217;s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\u003C\u002Fp\u003E\n\n\n\n\u003Cblockquote class=\"wp-block-quote\"\u003E\u003Cp\u003EHi there! I&#8217;m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin&#8217; caught in the rain.)\u003C\u002Fp\u003E\u003C\u002Fblockquote\u003E\n\n\n\n\u003Cp\u003E&#8230;or something like this:\u003C\u002Fp\u003E\n\n\n\n\u003Cblockquote class=\"wp-block-quote\"\u003E\u003Cp\u003EThe XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.\u003C\u002Fp\u003E\u003C\u002Fblockquote\u003E\n\n\n\n\u003Cp\u003EAs a new WordPress user, you should go to \u003Ca href=\"http:\u002F\u002Flocalhost:3000\u002Fwp-admin\u002F\"\u003Eyour dashboard\u003C\u002Fa\u003E to delete this page and create new pages for your content. Have fun!\u003C\u002Fp\u003E\n",protected:a},excerpt:{rendered:"\u003Cp\u003EThis is an example page. It&#8217;s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this: Hi there! I&#8217;m a bike messenger [&hellip;]\u003C\u002Fp\u003E\n",protected:a}}]},serverRendered:true,routePath:"\u002Fsurvey",config:{_app:{basePath:"\u002F",assetsPath:"\u002F_nuxt\u002F",cdnURL:b}}}}(false,null));